import React, {useState} from 'react';
import {Button, Div, Img, P, Span} from './profile';
import {AppstoreOutlined, PlusOutlined} from "@ant-design/icons";

const tabObj = {
    0: 'jake',
    1: 'pin',
    2: 'navy'
}

const Profile = ({user}) => {
    const [activeId, setActiveId] = useState(0);

    const clickHandler = (id) => {
        setActiveId(id)
    }
    return (
        <Div container>
            <Div header>
                <Div img>
                    <Img src={process.env.PUBLIC_URL + '/Img/user-icon.jpeg'}/>
                    <P>{user.nick}</P>
                    <Span><PlusOutlined /></Span>
                </Div>

                <Div line>
                    <p>0</p>
                    <p>게시물</p>
                </Div>
                <Div line>
                    <p>
                        {
                            user.Followings && Object.keys(user.Followings).length
                        }
                    </p>
                    <p>팔로잉</p>
                </Div>
                <Div line>
                    <p>
                        {
                            user.Followers && Object.keys(user.Followers).length
                        }
                    </p>
                    <p>
                        팔로워
                    </p>
                </Div>
            </Div>
            <Div line>
                <Button>프로필 편집</Button>
            </Div>
            <Div line>
                <ul className="tabs">
                    <li onClick={() => clickHandler(0)}>
                        <AppstoreOutlined />
                    </li>
                    <li onClick={() => clickHandler(1)}>Second</li>
                    <li onClick={() => clickHandler(2)}>Third</li>
                </ul>
                <div className="contents">{tabObj[activeId]}</div>
            </Div>
        </Div>
    );
};

export default Profile;
